module.exports={isPrime:e=>{if(!Number.isInteger(e)||e<=2||e%2===0)return false;const r=Math.sqrt(e);for(let t=3;t<=r;t++){if(e%t===0)return false}return true},findPrime:(...e)=>{const r=Array.from(new Set(e.filter(e=>Number.isInteger(e))));return r.reduce((e,r,t,s)=>{const i=Math.sqrt(r);let f={number:r,isPrime:true};if(r<=2||r%2===0){f.isPrime=false}else{for(let e=3;e<=i;e++){if(r%e===0)f.isPrime=false}}e.push(f);return e},[])}};